import React from 'react';
import { slide as Menu } from 'react-burger-menu';
import { NavLink } from 'react-router-dom';

/** Import assets */
import './sidebar.css';

class Sidebar extends React.Component {
  render() {
    const props = this.props;

    return (
      <Menu {...props} menuClassName="shadow-sm">
        <ul className="sidebar-menu-container card p-2 list-group list-group-flush text-center d-flex flex-column align-items-start shadow-sm">
          <NavLink
            activeClassName="active"
            to={`/home`}
            className="px-1 py-3 list-group-item list-group-item-action d-flex flex-column"
          >
            <i className="fa fa-home" />
            <small className=" mt-2">Home</small>
          </NavLink>
          <NavLink
            activeClassName="active"
            to={'/exercise'}
            className="px-1 py-3 list-group-item list-group-item-action d-flex flex-column"
          >
            <i className="fa fa-home" />
            <small className="mt-2">Exercise</small>
          </NavLink>
          <NavLink
            activeClassName="active"
            to={'/food'}
            className="px-1 py-3 list-group-item list-group-item-action d-flex flex-column"
          >
            <i className="fa fa-home" />
            <small className="mt-2">Foods</small>
          </NavLink>
          <NavLink
            activeClassName="active"
            to={`/supplements`}
            className="px-1 py-3 list-group-item list-group-item-action d-flex flex-column"
          >
            <i className="fa fa-home" />
            <small className="mt-2">Supplements</small>
          </NavLink>

        </ul>
      </Menu>
    );
  }
}

export default Sidebar;
